import {Link} from "react-router-dom";
import "./SignIn.css"


function SignIn(){

    return(

        // <h1 className="redfont"> Netflix</h1>

    <div className="base">
    <image src="https://assets.nflxext.com/ffe/siteui/vlv3/594f8025-139a-4a35-b58d-4ecf8fdc507c/6fa56356-45b4-4c99-8fa0-e2d76468e004/CA-en-20240108-popsignuptwoweeks-perspective_alpha_website_small.jpg"></image>


   <div className="SignInContainer">

   <h1 className="signintext">Sign In</h1>

<form action="/SignUp.js">
   <div className="inputs">
   <input className="backGrey" type="text" placeholder="Email or phone number"></input>
   <input className="backGrey" type="text" placeholder="Password"></input>
   <input type="submit" value="Submit"></input>
   </div>
   {/* <button>Submit</button> */}
   <input type="checkbox"></input>
   {/* <p>Need help?</p> */}

   {/* <p> New to Netflix? Sign Up now!</p> */}
</form>





   </div>


    </div>);



}


export default SignIn;
